import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import { Button } from '@material-ui/core';

function changeSizeByBtn() {
    document.getElementById('text').style.fontSize= 95 +'px';
}
function decreaseSizeByBtn() {
    document.getElementById('text').style.fontSize= 50 +'px';
}
function stopVideo(){
    document.getElementById('vid').remove();  
}

function Navbar() {

    return (
            <nav className='navbar'>
                <div className='nav-container'>
                    <div className="nav-item">
                        <h1>Font Size</h1>
                        <Button onClick={decreaseSizeByBtn}>-</Button>
                        <Button onClick={changeSizeByBtn}>+</Button>
                    </div>
                    <li className='nav-item'>
                        <Link to='/sign-up' className='nav-link'>
                            Sign Up
                        </Link>
                    </li>
                    <Link to='/' className='navbar-logo'>
                        TwoLlama Travels
                    </Link>
                    <li className='nav-item'>
                        <Link to='/log-in' className='nav-link'>
                            Log In
                        </Link>
                    </li>
                    <Button onClick={stopVideo}>No Background</Button>
                </div>
            </nav>
    )
}

export default Navbar
